package com.ada.common;public class ResultFileUpload {    private int rowSuccess;    private int rowError;    public ResultFileUpload(int rowSuccess, int rowError) {        this.rowSuccess = rowSuccess;        this.rowError = rowError;    }    public int getRowSuccess() {        return rowSuccess;    }    public void setRowSuccess(int rowSuccess) {        this.rowSuccess = rowSuccess;    }    public int getRowError() {        return rowError;    }    public void setRowError(int rowError) {        this.rowError = rowError;    }}